import { OwpButton, OwpDialog, OwpMessage, OwpSession } from 'owp/wrapper';
import React, { Component } from 'react';
import { mutate } from 'owp/api';
import * as TGEvent from 'owp/TGEvent';

class DialogReweighing extends Component {
    constructor(props) {
        super(props);
        this.owpDialog = React.createRef();
        this.onDelete = this.onDelete.bind(this);
        this.onDeleteClick = this.onDelete.bind(this);
        this.state = {};
    }

    deleteDialogOpen = () => {
        
        if (this.props.CODEID === '' || this.props.CODEID === null || this.props.CODEID === undefined) {
            OwpMessage({
                message: '삭제할 데이터를 선택해 주세요',
                variant: 'warning',
            });
            this.deleteDialogClose();
        } else {
            this.setState({ deleteDialogOpen: true });
        }
    };

    deleteDialogClose = () => {
        this.owpDialog.handleClose();
    };

    onDelete = async (type) => {
        const data = {
            'cudtype': 'delete',
            'IPX_COMMONCODE.WUSERSEQ': OwpSession('USERSEQ') + '', // : 로그인사용자SEQ
            'IPX_COMMONCODE.CODEID': this.props.CODEID,
            'IPX_COMMONCODE.FLAG': 'N',
        };

        const result = await mutate({
            url: 'deleteIpxCommoncode/' + this.props.CODEID + '',
            data,
        }).then((res) => {
            const G = TGEvent.getGridByID('C802001');
            G.ReloadBody();
            this.props.authorityGroupClearProps();
            const G1 = TGEvent.getGridByID('C802002');
            G1.ReloadBody();
        })
        .catch((error) => {
            console.error(error);
        })
        .finally(() => {
            this.deleteDialogClose();
        });
    };

    onDeleteClick() {
        this.onDelete('START');
    }

    render() {
        return (
            <OwpDialog
                title={null}
                callbackFunction={this.deleteDialogOpen}
                dialogButton="삭제"
                dialogActions={
                    <React.Fragment>
                        <div>
                            <OwpButton color="secondary" variant="contained" onClick={this.onDeleteClick}>
                                예
                            </OwpButton>
                            <OwpButton color="default" variant="contained" onClick={this.deleteDialogClose}>
                                아니오
                            </OwpButton>
                        </div>
                    </React.Fragment>
                }
                innerRef={(ref) => (this.owpDialog = ref)}
                width="211px"
                height="18px"
            >
                <React.Fragment>
                    <div className="left mg0 pd0" style={{ fontSize: '14px' }}>
                        삭제하시겠습니까?
                    </div>
                </React.Fragment>
            </OwpDialog>
        );
    }
}

export default DialogReweighing;
